export const StateContext = createContext();

export const  SateProvider = (props)=> {

    const [users, setUsers] = useState([{Name:'', Role:''}]);
    return (
        <StateContext.Provider value={[users, setUsers]}>
            {props.children}
        </StateContext.Provider>
    );
}
